LL,NULL,NULL,''),(381,22,367,NULL,'LÉ...: É! É! E! / ISTO, RIA, LEGAL, MAS NÃO TEM MORAL? /-<br />\nTEM: O BURACO É FUNDO ACABOU-SE IMUNDO / ELA DOU-<br />\nGALGALADAS, FUNGO O NARIZ TRISTESO, OLYMPIA-SE NO-<br />\nTRICLÍNIO / DÓI MEXER-ME ALGEGAMADA COMO UMA ARTE /-<br />\nEXPERIMENTA AQUELA DA NEGRATA RO AZ DO HOLANDÊS,-<br />\nMEIAS BRANCAS ATÉ MEIAS COXAS, TODO PINCEL EM LINHAS-<br />\nTRÊMULAS NAS CARNES DO AR, DANDO O QUE MAIS TEM DE-<br />\nDENTRO COMO SOCO PELUDO, OS BICOS DOS SEIOS BOCAS-<br />\nSACANAS, NEGRA HERIDA NOSTALGICA DE TOROS... E COM-<br />\nO VOCÊ TALA BEM Ê BOCA PEQUENA... OU AQUELA DO NON-<br />\nCOURBET, QUATRO PEITOS A PEITOS, MONTANHAS BRABAS-<br />\nDE COXAS DORMINDO SEUS BURACOS, AS DUAS CONTINHAS-<br />\nDE PÉROLAS DESFIANDAS ROLANDAS DO COPO Ê COLCHA O-<br />\nNDE ESTÁ A COISA ENORME COMEMSUMADA… MAS CHEGA-<br />\nDE PINUPLITERALMENTATURA… CANTA UM CONTO DE FAD-<br />\nAS, CONTA UM CANTO DE FADOS / ORA UMA VOZ UM RUI QUE-<br />\nNÃO TINHA FALHAS. UM DIA, SOPRANA, A SÓBRIA, ESTAVA-<br />\nFAZENDA UM TRAPALHO DE AGUIA, BICOU-SE NA PINTA DO-<br />\nDADO E SAIU MANGUE. FOZ UM DESEJO , MAS NÃO CANTOU-<br />\nPRO RUI, QUE LHE DEU UMA BRONCA DE NOVE E NÃO QUIS-<br />\nCABER MAIS DELA / ELA ARREGANHAMOS TANTO TANTAS-<br />\nVEZES AS GENGIVAGINHAS ‚—-<br />\nLRRGNHMSTNTTNTSVZSSGNGVGNHS ‚— QUE QUASE NOS ENG-<br />\nASGAMOS NO VINHO SALIVAR, ATÉ QUE VEIO UMA SAUDADE,-<br />\nVIREI A CABEÇA, SENTI NA TONSURA OS PENTES DOS SEUS-<br />\nCABELOS QUENTES MOLHADOS, ME LEMBRAMOS DO TEMPO-<br />\nEM QUE RIVEDEREIS AS OUTRAS ESTRELAS.',NULL,NULL,NULL,NULL,NULL,''),(382,23,368,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(383,24,369,159,'159',NULL,NULL,NULL,NULL,NULL,''),(384,26,370,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(385,27,370,200,'200',NULL,NULL,NULL,NULL,NULL,''),(386,22,371,NULL,'<br />\ntoda regra tem exceção<br /><br />\nesta regra tem exceção nem toda regra tem exceção<br /><br />\nnem esta regra tem exceção',NULL,NULL,NULL,NULL,NULL,''),(387,23,372,